      'id': 25696051,
      'title': 'Clinton means continuity for US economy, Trump the unknown',
      'body': 'Survey by the CNBC network of economists and Wall Street participants showed 46% feel Donald Trump would be better for the economy compared to 39% favoring Hillary Clinton\n\nOn taxes, public spending and protectionism the two candidates for the White House are diametrically opposed: Hillary Clinton represents continuity while Donald Trump seduces or frightens with his radical proposals.\n\nBut while many economists are alarmed by the threat Trump poses to American prosperity, there is no shortage of small business owners and investors who believe the Republican candidate\'s plans would benefit the economy.\n\nWith polls showing the candidates are neck-and-neck just days before Tuesday\'s election, the race could be summed up as "Wall Street is pro-Clinton, Main Street is pro-Trump," said Steve Odland, of the Committee for Economic Development, a non-partisan, business-led economic policy group.\n\nBut even Wall Street is somewhat ambivalent. A survey conducted by the CNBC network last week with 50 economists and Wall Street participants showed 82 percent think Clinton will win, but 46 percent feel Trump would be better for the economy, compared to 39 percent favoring Clinton.\n\nAnother survey conducted in October by the Pepperdine/Graziadio Business School in Los Angeles with 1,353 small businesses across the country, shows a majority of employers prefer Trump due to his positions on health insurance (55 percent to 45 percent for Clinton), as well as on taxes (66 percent to 34 percent) and trade (55 percent to 45 percent).\n\nTrump\'s economic plan aims to revive economic activity through deregulation. He promises to achieve 3.5-4 percent growth -- compared to 1.8 percent projected for 2016 -- by cutting the corporate tax rate to 15 percent from 35 percent, and lowering the income tax rate for wealthy taxpayers -- the highest bracket would drop to 33 percent from 39.6 percent. The impact would be a sharp increase in the budget deficit.\n\nTrump also has promised to renegotiate US trade agreements, repeal the "Obamacare" health insurance program, and erect a wall on the US-Mexico border to prevent illegal immigration.\n\nIn contrast, Clinton would mostly stick to President Barack Obama\'s economic path.\n\nThe Democratic candidate\'s plan includes raising taxes of the richest taxpayers, increasing the federal minimum wage, providing free local universities for the less affluent, and reforming Obamacare. Her plan also would widen the deficit but to a lesser extent.\n\nTrump is worrying the academic world: no less than 370 economists, including several Nobel Prize winners, signed an open letter in the Wall Street Journal appealing to voters to "choose another candidate", saying Trump spreads disinformation and "promotes magical thinking."\n\n"Donald Trump is a dangerous, destructive choice for the country. He misinforms the electorate, degrades trust in public institutions with conspiracy theories, and promotes willful delusion over engagement with reality," the letter said.\n\nEven the International Monetary Fund is alarmed by the specter of growing protectionism, from Trump to Britain\'s vote to pull out of the European Union, which it says is a threat to global growth.\n\nOdland said Trump\'s style attracts some in the business world because he speaks to voters in the familiar blunt patter of a real estate developer negotiating a deal.\n\n"We in the retail industry have to negotiate all the time with commercial real estate developers. They are bombastic, they are emotional, they come at things in a way that frankly sounds crazy," Odland said.\n\n"He\'s approaching geopolitics in the same way. Is it right? Well it\'s unconventional. His supporters say, \'Well, maybe it will end up to be a better deal for us,\' and that\'s why they are willing to make the bet."\n\nAnalysts at Capital Economics said that Trump\'s pitch might be exaggerated.\n\n"A Trump victory might not result in the radical changes that many fear. He would probably soften his rhetoric on trade policy once in the Oval Office and would struggle to push his plans for fiscal policy through Congress."\n\nBut in the immediate aftermath of the election, a Trump victory, or worse a disputed vote, will send Wall Street lower.\n\nAnalysts estimate a Trump win would send the broad S&P 500 index below the 2,000 level, about 5 percent lower than the week before the vote. That is what the index did on June 27, the day markets were shocked by the Brexit vote. But it was not long before the index rebounded.',
